import React from 'react';

const Footer = () => {
  return (
    <footer style={footerStyle}>
      <p>&copy; 2025 Polysia. All Rights Reserved.</p>
    </footer>
  );
};

const footerStyle = {
  backgroundColor: '#333', // Darker background for contrast
  color: '#fff',           // White text color
  textAlign: 'center',
  padding: '15px 0',       // Increased padding for better spacing
  position: 'fixed',
  width: '100%',
  bottom: '0',
  fontSize: '14px',        // Slightly smaller font size for footer text
  boxShadow: '0 -4px 6px rgba(0, 0, 0, 0.1)', // Light shadow for depth
};

export default Footer;
